import React from 'react';
import './App.css';
import GoogleMapReact from 'google-map-react'

let center={
    lat:51.527452,
    lng:-0.124975
};

function App() {
  return (
    <div className="App">
        <GoogleMapReact
            center={center}
            zoom={5}
        >
        </GoogleMapReact>
    </div>
  );
}

export default App;
